import React from "react";


class IdadeDeFuano extends React.Component {
  render() {
    const { value, handleChange} = this.props;


    return(
      <label>
          Diga sua idade:
          <input 
            type="number"
            name='idade'
            value={value}
            onChange={handleChange}
          />

        </label>
    )
  }
}

export default IdadeDeFuano;
